                  <Route path="project1" element={<Project1 />} />
                  <Route path="project2" element={<Project2 />} />
                  <Route path="project3" element={<Project2 />} />
                  <Route path="project4" element={<Project2 />} />
                  <Route path="project5" element={<Project2 />} />
                  <Route path="project6" element={<Project2 />} />
                  <Route path="project7" element={<Project2 />} />
                  <Route path="project8" element={<Project2 />} />
                  <Route path="project9" element={<Project2 />} />
                  <Route path="project10" element={<Project2 />} />
                </CSSTransition>
              </TransitionGroup>
            </Route>
          </Routes>
        </CSSTransition>
      </TransitionGroup>
    </div>
  );
}

export default App;
